if mibBuilder.loadTexts: vctDnaCugPrivileged.setDescription("This attribute, if set to yes indicates that this Cug is a privileged Cug. In DPN, at least one side of a call setup within a Cug must have the Cug as a privileged Cug. If set to no, then the Cug is not privileged. If both the local DTE and the remote DTE subscribe to the Cug, but it is not privileged, then the call will be cleared. This attribute is typically used for a host DTE which must accept calls from many other DTE's in which case the other DTE's cannot call one another, but can call the host. In this example, the host would have the privileged Cug, and the other DTE's would belong to the same Cug, but it would not be privileged.")
