vctDcType = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 5130, 3, 10, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3, 4))).clone(namedValues=NamedValues(("switched", 0), ("permanentMaster", 1), ("permanentSlave", 2), ("permanentBackupSlave", 3), ("permanentSlaveWithBackup", 4))).clone('switched')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: vctDcType.setStatus('mandatory')
if mibBuilder.loadTexts: vctDcType.setDescription('This attribute specifies the type of Vc call: switched, permanentMaster, permanentSlave, permanentSlaveWithBackup, permanentBackupSlave. If the value of this attribute is set to switched then the remote end must also be provisioned as switched. No information at the remote end is defined about this switched interface. If the value is set to permanentMaster, then a permanent connection will be established between 2 ends. The remote end must be defined as a permanentSlave, permanentBackupSlave or permanentSlaveWithBackup. The connection cannot be established if the remote end is defined as anything else. The end defined as permanentMaster always initiates the calls. It will attempt to call once per minute. If the value is set to permanentSlave then a permanent connection will be established between 2 ends. The remote end must be defined as a permanentMaster. The connection cannot be established if the remote end is defined as anything else. The permanentSlave end will attempt to call once per minute. If the value is set to permanentSlaveWithBackup then a permanent connection will be established between the two ends. The remote end must be defined as a permanentMaster. The connection cannot be established if the remote interface end is defined as anything else. The permanentSlaveWithBackup end will attempt to call once per minute. When type is set to permanentSlaveWithBackup connection will be cleared if interface becomes unavailable. This enables a retry of the connection which can be redirected to permanentBackupSlave. If the value is set to permanentBackupSlave then a permanent connection will be established between the 2 ends only if the permanentMaster end is disconnected from the permanentSlaveWithBackup end and a backup call is established by the redirection system. If the permanentSlaveWithBackup interface becomes available again, the permanentBackupSlave end is disconnected and the permanentSlaveWithBackup end is reconnected to the permanentMaster end. The permanentBackupSlave end does not try to establish pvc call.')
vctDcSvcAutoCallRetry = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 5130, 3, 10, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("no", 0), ("yes", 1))).clone('no')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: vctDcSvcAutoCallRetry.setStatus('mandatory')
if mibBuilder.loadTexts: vctDcSvcAutoCallRetry.setDescription('svcAutoCallRetry is used only for switched calls, in which case the attribute type is set to switched. Otherwise, this attribute is ignored by the Vcs. This attribute, if set to yes for Svc, indicates that the Vc will continually try to establish the SVC rather than clearing the Vc after the first unsuccessful call attempt. Further, if the call fails while in data transfer phase, then the Vc will automatically attempt to reconnect. The call attempts are made by the Vc once per time provisioned in InterfaceOptions as callRetryTimer, repeatedly. If set to no for SVCs, then the Vc behaves in the standard mode, making a single call attempt.')
vctDcUserData = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 5130, 3, 10, 1, 8), HexString().subtype(subtypeSpec=ValueSizeConstraint(0, 128))).setMaxAccess("readwrite")
